var title_f0_59_952="Dose adj pharmacogenetics";
var content_f0_59_952=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F78144&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F78144&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 595px\">",
"   <div class=\"ttl\">",
"    Examples of dose adjustments based on PGDx",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 575px; height: 463px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The influence of genetic polymorphisms in cytochrome P450 enzymes CYP2D6, CYP2C19 and CYP2C9, thiopurine",
"    <em>",
"     S",
"    </em>",
"    -methyltransferase (TPMT) and",
"    <em>",
"     N",
"    </em>",
"    -acetyltransferase type 2 (NAT2) is expressed as subpopulation-specific dosages, according to the difference in pharmacokinetic parameters from clinical studies. The dose adjustments illustrated by the bars in this graph are based on differences in dose-related pharmacokinetic parameters (clearance, AUC, STEADY STATE CONCENTRATION) caused by particular genotypes and are calculated using the methods described earlier. Substantial adjustments need to be made to drug dose to achieve the same level of drug exposure in individuals with different genotypes.",
"    <div class=\"footnotes\">",
"     AUC: area under the curve; EM: extensive metabolizer; IA: intermediate acetylator; IM: intermediate metabolizer; PM: poor metabolizer; RA: rapid acetylator; SA: slow acetylator; UM: ultra-rapid metabolizer.",
"    </div>",
"    <div class=\"reference\">",
"     Reprinted by permission from Macmillan Publishers LTD: Kirchheiner J, Fuhr U, Borckmoller J. Pharmacogenetics-based therapeutic recommendations--ready for clinical practie? Nat Rev Drug Discov 2005; 4:639. Copyright &copy; 2005.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
