var title_f0_59_958="ABVD chemotherapy for Hodgkin lymphoma";
var content_f0_59_958=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F68131&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F68131&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    ABVD chemotherapy for Hodgkin lymphoma",
"    <sup>",
"     [1]",
"    </sup>",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"4\" width=\"25%\">",
"     </colgroup>",
"     <tbody>",
"      <tr class=\"divider_bottom\">",
"       <td colspan=\"4\">",
"        Cycle length: 28 days.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Drug",
"       </td>",
"       <td class=\"subtitle1\">",
"        Dose and route",
"       </td>",
"       <td class=\"subtitle1\">",
"        Administration",
"       </td>",
"       <td class=\"subtitle1\">",
"        Given on days",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Doxorubicin",
"        </strong>",
"       </td>",
"       <td>",
"        25 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        IV",
"       </td>",
"       <td>",
"        Dilute in 50 mL normal saline (NS) and administer over three to five minutes or IV push through a peripheral line.",
"       </td>",
"       <td>",
"        Days 1 and 15",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Bleomycin",
"        </strong>",
"        *",
"       </td>",
"       <td>",
"        10 units/m",
"        <sup>",
"         2",
"        </sup>",
"        IV",
"       </td>",
"       <td>",
"        <p>",
"         Dilute in 50 mL NS and administer over 10 minutes or IV push through a peripheral line.",
"        </p>",
"        <p>",
"         Test dose of 2 units given one hour before full dose can be considered for the first cycle",
"         <sup>",
"          &Delta;",
"         </sup>",
"         .",
"        </p>",
"       </td>",
"       <td>",
"        Days 1 and 15",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Vinblastine",
"        </strong>",
"       </td>",
"       <td>",
"        6 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        IV",
"       </td>",
"       <td>",
"        Administer over one minute.",
"       </td>",
"       <td>",
"        Days 1 and 15",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Dacarbazine",
"        </strong>",
"       </td>",
"       <td>",
"        375 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        IV",
"       </td>",
"       <td>",
"        <p>",
"         Central line: Dilute in 250 mL of 5 percent dextrose (D5W) and administer over 30 minutes.",
"        </p>",
"        <p>",
"         Peripheral line: Dilute in 500 mL of D5W and administer over 60 minutes.",
"        </p>",
"        <p>",
"         Dacarbazine should be protected from light.",
"        </p>",
"       </td>",
"       <td>",
"        Days 1 and 15",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Pretreatment considerations:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Emesis risk:",
"        </strong>",
"        HIGH (&gt;90 percent frequency of emesis). Refer to UpToDate topic on \"Prevention and treatment of chemotherapy-induced nausea and vomiting\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Prophylaxis for infusion reactions:",
"        </strong>",
"        A bleomycin test dose may be administered before the first cycle. Premedicate with acetaminophen prior to administration of the full bleomycin dose. Refer to UpToDate topic on \"Infusion reactions to systemic chemotherapy\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Vesicant/irritant properties:",
"        </strong>",
"        Doxorubicin and vinblastine are vesicants. Refer to UpToDate topic on \"Extravasation injury from chemotherapy and other non-neoplastic vesicants\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Infection prophylaxis:",
"        </strong>",
"        Primary prophylaxis with G-CSF is generally not indicated, and G-CSF is avoided in some centers because of concerns that concurrent use may increase bleomycin lung toxicity. Refer to UpToDate topic on \"Bleomycin-induced lung injury\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Dose adjustment for baseline liver or renal dysfunction:",
"        </strong>",
"        A 25 percent dose reduction in bleomycin is recommended for patients with creatinine clearance 10 to 50 mL/min, and a 50 percent reduction for clearance &lt;10 mL/min. Chemotherapy dose adjustments for doxorubicin and vinblastine are needed in patients with cholestasis or AST/ALT abnormalities. Refer to UpToDate topics on \"Chemotherapy hepatotoxicity and dose modification in patients with liver disease\" and \"Chemotherapy-related nephrotoxicity and dose modification in patients with renal insufficiency\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Monitoring parameters:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull; Assess CBC with differential weekly during treatment. Assess electrolytes, renal function, and liver function prior to each treatment cycle.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull; Cumulative doxorubicin dose should be monitored. Measure left ventricular ejection fraction prior to first cycle, then as clinically indicated.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull; Monitor for respiratory complaints or unexplained findings on lung exam (eg, rales). Maximum bleomycin lifetime dose not to exceed 400 mg. Measure pulmonary diffusion capacity before first cycle and then per institutional policy. Refer to UpToDate topic on \"Bleomycin-induced lung injury\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Suggested dose modifications for toxicity:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Myelotoxicity:",
"        </strong>",
"        Hold treatment until the WBC count is &gt;2500/microL and the platelet count &gt;80,000/microL on the day of treatment.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Pulmonary toxicity:",
"        </strong>",
"        Bleomycin should be discontinued in patients with documented or strongly sustpected bleomycin-induced lung injury. Refer to UpToDate topic on \"Bleomycin-induced lung injury\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Neuropathy:",
"        </strong>",
"        For severe paresthesias and/or constipation, the dose of vinblastine should be reduced by 50 percent. Vinblastine should be discontinued permanently if an adynamic ileus occurs.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"4\">",
"        <strong>",
"         If there is a change in body weight of at least 10 percent, dose should be recalculated for all drugs.",
"        </strong>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <strong>",
"     This table is provided as an example of how to administer this regimen; there may be other acceptable methods. This regimen must be administered by a clinician trained in the use of chemotherapy. The clinician is expected to use his or her independent medical judgment in the context of individual circumstances to make adjustments, as necessary.",
"    </strong>",
"    <div class=\"footnotes\">",
"     IV: intravenous; G-CSF: granulocyte-colony stimulating factors; AST: aspartate aminotransferase; ALT: alanine aminotransferase; CBC: complete blood count; WBC: white blood cell.",
"     <br/>",
"     * 1 mg bleomycin = 1 unit bleomycin.",
"     <br/>",
"     &Delta; A test dose of bleomycin before the first dose is recommended by the manufacturer",
"     <sup>",
"      [2]",
"     </sup>",
"     ; however, many institutions no longer perform this test dose. Refer to UpToDate topic on \"Infusion reactions to systemic chemotherapy\".",
"    </div>",
"    <div class=\"reference\">",
"     References:",
"     <br/>",
"     <ol>",
"      <li>",
"       Canellos GP, et al. N Engl J Med 1992; 327:1478.",
"      </li>",
"      <li>",
"       Blenoxane (bleomycin sulfate) injection. US FDA-approved manufacturer's package insert. US National Library of Medicine. (Available online at dailymed.nlm.nih.gov, accessed on January 3, 2012).",
"      </li>",
"     </ol>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
